import IsLoggedIn, { logout, getCurrentUser } from "../utilities/loginStatus";
import { useNavigate } from "react-router-dom";
import React, { useEffect, useState } from "react";

// icons
import opMail from "./icons/op-mail.svg";
import opSet from "./icons/op-settings.svg";
import opLogOut from "./icons/op-log-out.svg";
import infoUser from "./icons/info-user.svg";
import infoHash from "./icons/info-hash.svg";
import infoMail from "./icons/info-mail.svg";
import menuDash from "./icons/menu-dash.svg";
import menuDashActive from "./icons/menu-dash-active.svg";
import menuEdit from "./icons/menu-edit-2.svg";
import menuEditActive from "./icons/menu-edit-2-active.svg";
import menuCross from "./icons/menu-crosshair.svg";
import menuCrossActive from "./icons/menu-crosshair-active.svg";
import menuClock from "./icons/menu-clock.svg";
import menuClockActive from "./icons/menu-clock-active.svg";
import menuFile from "./icons/menu-file-text.svg";
import menuFileActive from "./icons/menu-file-text-active.svg";
import menuCmt from "./icons/menu-message-square.svg";
import menuCmtActive from "./icons/menu-message-square-active.svg";

function SecondSide() {
  const navigate = useNavigate();
  const [sideState, setSideState] = React.useState("dash");
  if (getCurrentUser) {
    console.log(getCurrentUser);
    var username = getCurrentUser.username;
    var email = getCurrentUser.email;
    var id = getCurrentUser.id;
    var roles = [];
    getCurrentUser.roles.forEach((x, i) =>
      roles.push(x.slice(5).toLowerCase())
    );
    // console.log(roles);
  }
  const path = window.location.pathname;
  return (
    <aside>
      <div className="user-sidebar">
        <div className="avatar-container">
          <img src="https://cdn.jsdelivr.net/gh/liangchuxin/blog-files/img/20210315225826.jpg" />
        </div>
        <div className="user-name">@{username.toUpperCase()}</div>
        <div className="operations">
          <div className="op-btn">
            <img src={opMail} />
          </div>
          <div className="op-btn">
            <img src={opSet} />
          </div>
          <div className="op-btn" title="log out" onClick={() => logout()}>
            <img src={opLogOut} />
          </div>
        </div>
        <div className="user-info">
          <div className="divider top" />
          <div className="account">
            <img src={infoUser} />
            <span>{username.toLowerCase()}</span>
          </div>
          <div className="uid">
            <img src={infoHash} />
            <span>{id.toString().padStart(7, "0")}</span>
          </div>
          <div className="mail">
            <img src={infoMail} />
            <span>{email}</span>
          </div>
          <div className="badges">
            {roles.map((role) => (
              <div className={`badge ${role}`} title={role}>
                <span className="color-container"></span>
                <span>{role.charAt(0).toUpperCase() + role.slice(1)}</span>
              </div>
            ))}
          </div>
          <div className="divider bottom" />
        </div>
        <div className="main-menu">
          <div
            className={`menu-block ${path === "/user" ? `active` : ``} `}
            onClick={() => {
              navigate("/user");
            }}
          >
            <img src={path === "/user" ? menuDashActive : menuDash} />
            <span>Dashboard</span>
          </div>
          <div
            className={`menu-block ${
              path === "/user/past-problems" ? `active` : ``
            } `}
            onClick={() => {
              navigate("/user/past-problems");
            }}
          >
            <img
              src={path === "/user/past-problems" ? menuFileActive : menuFile}
            />
            <span>Past Problems</span>
          </div>
          <div
            className={`menu-block ${
              path === "/user/subject-topics" ? `active` : ``
            } `}
            onClick={() => {
              navigate("/user/subject-topics");
            }}
          >
            <img
              src={
                path === "/user/subject-topics" ? menuCrossActive : menuCross
              }
            />
            <span>Subjects & Topics</span>
          </div>
          <div
            className={`menu-block ${
              path === "/user/comments" ? `active` : ``
            } `}
            onClick={() => {
              navigate("/user/comments");
            }}
          >
            <img src={path === "/user/comments" ? menuCmtActive : menuCmt} />
            <span>Comments</span>
          </div>
          <div
            className={`menu-block ${path === "/user/add" ? `active` : ``} `}
            onClick={() => {
              navigate("/user/add");
            }}
          >
            <img src={path === "/user/add" ? menuEditActive : menuEdit} />
            <span>Add a story</span>
          </div>
          <div
            className={`menu-block ${
              path === "/user/history" ? `active` : ``
            } `}
            onClick={() => {
              navigate("/user/history");
            }}
          >
            <img src={path === "/user/history" ? menuClockActive : menuClock} />
            <span>Game History</span>
          </div>
        </div>
      </div>
    </aside>
  );
}
export default SecondSide;
